SD, and 3,390,670 USD, respectively).\n","\n","- Tuesdays were found to be the most profitable day for advertising, generating 5,087,957 USD, while Thursdays had the lowest number of sales(4,839,465 USD).\n","\n","- The best times for advertising were between 9:00-12:00 and 16:00-19:00,when the company typically had the highest sales counts.\n","\n","- Top 5 Best selling product are USB-C Charging Cable, Lightning Charging Cable, AAA Batteries (4-pack), AA Batteries (4-pack) and Wired Headphones.\n","\n","- Products that are often sold together are iPhone and Lightning Charging Cable which sold 1,764 orders, and Google Phone, USB-C Charging Cable ranked second with 1,712 orders, and the third most are iPhone and Wired Headphones 722 orders.\n","\n","- The probability of customers ordering specific products compared to all other products was calculated as following: \n","       * USB-C Charging Cable: 11.77% \n","       * iPhone: 3.67% \n","       * Google Phone: 2.97% \n","       * Wired Headphones: 10.15%"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":21.30919,"end_time":"2023-04-28T09:46:07.744903","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2023-04-28T09:45:46.435713","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}